import React from 'react';

export default class Form extends React.Component{
      render(){
            return(
                  <form>
                        <input type="text" placeholder="City..." name="city"/>
                        <input type="text" placeholder="Country..." name="country"/>
                        <button className="submitBtn"></button>
                  </form>
            )
      }
}
